content:
Cần bán nhà đường Lê Đình Cẩn, P.Tân Tạo, Bình Tân;



Nhà 4 tấm đúc thật, mặt tiền hẻm 5m, thông thoáng, giao thông thuận lợi, nhà có giếng trời thoáng mát, có sân thượng và sân phơi rộng view đẹp;

Nhà hướng Nam, sổ hồng riêng chính chủ, sang tên nhanh gọn;

Diện tích: 4*17m, 5PN, 5WC;

Giá: 4.6 tỷ;

Liên hệ: 0975.112233 A.Tuấn.

Nhà mặt tiền 1123 Huỳnh Tấn Phát, Q.7.
- Diện tích đất công nhận: 147,9m2; tổng DT đất: 166m2; DTXD: 147,9m2*8 + 147,9m2.

- Hầm = 1131 (m2); Gác lửng trong phòng: 11*25=275m2; Tổng DT sàn XD là 1400 m2;
Hầm: Để xe máy + kho;

- Tầng 1: 2 phòng studio + phía trước cho thuê làm shophouse + sân trước;
- Tầng 2: 5 phòng studio;
- Tầng 3,4,5,6,7: Mỗi tầng 5 phòng có duplex (gác) = 25 phòng có gác;
- Tầng 8: 3 phòng studio + sân thượng trước + sân phơi đồ phía sau nhà.
* Tổng cộng: 25 phòng có gác + 10 phòng studio.
* Đầy đủ nội thất;
* Đang có hợp đồng thuê 5 năm giá 170tr/tháng, 2 năm lên giá 7%;
* Nhà bán 31 tỷ.
